package String;

public class Compare {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s="bahuballi";
		String s1="Bahuballi";
		int s2=s.compareTo(s1);// .compare will gives us ASCII key values. So ASCII key values are in integer format.
		System.out.println(s2);// and our result will be in Integer Format.

	}

}
